                }
                return new SqlSelect(
                        SqlParserPos.ZERO,
                        null,
                        selectList,
                        orderBy.query,
                        null,
                        null,
                        null,
                        null,
                        orderList,
                        orderBy.offset,
                        orderBy.fetch,
                        null);
            }

