        for (Lockable<SharedBufferEdge> edge : sharedBufferNode.getElement().getEdges()) {
            if (version.isCompatibleWith(edge.getElement().getDeweyNumber())) {
                edge.lock();
            }
        }
        sharedBuffer.upsertEntry(node, sharedBufferNode);
    }
}

