private static char readStringChar(DataInputView source) throws IOException {
    int c = source.readByte() & 0xFF;

    if (c >= HIGH_BIT) {
        int shift = 7;
        int curr;
        c = c & 0x7F;
        while ((curr = source.readByte() & 0xFF) >= HIGH_BIT) {
            c |= (curr & 0x7F) << shift;
            shift += 7;
        }
        c |= curr << shift;
    }

    return (char) c;
}

