    } catch (Exception e) {
        exception = ExceptionUtils.firstOrSuppressed(e, exception);
    }

    try {
        jobTable.close();
    } catch (Exception e) {
        exception = ExceptionUtils.firstOrSuppressed(e, exception);
    }

    try {
        libraryCacheManager.shutdown();
    } catch (Exception e) {
        exception = ExceptionUtils.firstOrSuppressed(e, exception);
    }

    taskEventDispatcher.clearAll();

    if (exception != null) {
        throw new FlinkException(
                "Could not properly shut down the TaskManager services.", exception);
    }
}

