                    append(apiKey.id).append("): ").append("UNSUPPORTED");
            apiKeysText.put(apiKey.id, bld.toString());
        }
    }
    String separator = lineBreaks ? ",\n\t" : ", ";
    StringBuilder bld = new StringBuilder();
    bld.append("(");
    if (lineBreaks)
        bld.append("\n\t");
    bld.append(Utils.join(apiKeysText.values(), separator));
    if (lineBreaks)
        bld.append("\n");
    bld.append(")");
    return bld.toString();
}

