          Arrays.copyOf(adGroup.durationsUs, adGroup.durationsUs.length),
          adIndexInAdGroup,
          adDurationUs,
          adGroup.durationsUs[adIndexInAdGroup]);
  return adPlaybackState.withAdDurationsUs(adGroupIndex, adDurationsUs);
}

