	if (containingBd != null) {

		builder.setScope(containingBd.getScope());
	}
	if (parserContext.isDefaultLazyInit()) {

		builder.setLazyInit(true);
	}
	doParse(element, parserContext, builder);
	return builder.getBeanDefinition();
}

