public JSONArray toJSONArray(JSONArray names) {
	JSONArray result = new JSONArray();
	if (names == null) {
		return null;
	}
	int length = names.length();
	if (length == 0) {
		return null;
	}
	for (int i = 0; i < length; i++) {
		String name = JSON.toString(names.opt(i));
		result.put(opt(name));
	}
	return result;
}

