    if (hasDot) {
      ipString = convertDottedQuadToHex(ipString);
      if (ipString == null) {
        return null;
      }
    }
    if (percentIndex != -1) {
      ipString = ipString.substring(0, percentIndex);
    }
    return textToNumericFormatV6(ipString);
  } else if (hasDot) {
    if (percentIndex != -1) {
      return null; 
    }
    return textToNumericFormatV4(ipString);
  }
  return null;
}

