  }

  try {
    cacheChecked.get(new Object());
    fail();
  } catch (ExecutionException caughtEe) {
    assertThat(caughtEe).hasCauseThat().isSameInstanceAs(ee);
  }

  try {
    cacheChecked.getUnchecked(new Object());
    fail();
